import React from "react";
import "./App.css";
import Videos from "./pages/Videos";
import data from "./components/data/videos.json";

const VIDEOS = [
  {
    id: 1,
    name: "Bud Light",
    description: "AfactoryisworkingonthenewBudLightPlatinum.",
    standard: "PAL",
    definition: "SD",
    "start timecode": "00:00:00:00",
    "end timecode": "00:00:30:12",
  },
  {
    id: 2,
    name: "M&M's",
    description:
      'Ataparty,abrownshelledM&Mismistakenforbeingnaked.Asaresult, the red M&M tears off its skin and dances to "Sexy and I Know It" by LMFAO.',
    standard: "NTSC",
    definition: "SD",
    "start timecode": "00:00:00:00",
    "end timecode": "00:00:15:27",
  },
];

function App() {
  console.log("In App");
  console.log(VIDEOS);
  return (
    <div className="App">
      <Videos items={VIDEOS} />
    </div>
  );
}

export default App;
